import { Table, Tag, Space ,Button } from 'antd';

const columns = [
  {
    title: '名称',
    dataIndex: 'name',
    key: 'name',
    render: text => <a>{text}</a>,
  },
  {
    title: '收益代币',
    dataIndex: 'earnings',
    key: 'earnings',
  },
  {
    dataIndex: 'earn',
    key: 'earn',
    render:()=>(
        <Button type="primary">EARN</Button>
    )
  },
  {
    key: 'tags',
    dataIndex: 'tags',
    render: ()=>{
        <Button type="primary">"HARVEST"</Button>
    }
  },
  {
    key: 'action',
    render: (text, record) => (
      <Space size="middle">
        <a>Invite {record.name}</a>
        <a>Delete</a>
      </Space>
    ),
  },
];

const data = [
  {
    key: '1',
    name: 'John Brown',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    name: 'Jim Green',
    age: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser'],
  },
  {
    key: '3',
    name: 'Joe Black',
    age: 32,
    address: 'Sidney No. 1 Lake Park',
    tags: ['cool', 'teacher'],
  },
];







function Investment () {
    return(
        <Table columns={columns} dataSource={data} />
    )
}

export default Investment
